import React from 'react'; 
import { Provider } from 'react-redux';
import store from './store';
import logo from './assets/logo.png';
import { Background } from './styles';
import { HTML } from './styles'; 




export default function App() {
 return (
   <Provider store={store}>
     <Background>
           <div className="row">
        <div className="logo">
          <img src={logo} />
        </div>
      </div>
      <div class="nav-container"> 
        <a id="nav-menu" class="nav-menu">â˜° Menu</a>
        <ul class="nav-list " id="nav">
            <li> <a href="#" id="tile1"><i class="icon ion-ios7-home-outline"></i>HTML</a></li>
            <li> <a href="#" id="tile2"><i class="icon ion-ios7-person-outline"></i>CSS</a></li>
            <li> <a href="#" id="tile3"><i class="icon ion-ios7-briefcase-outline"></i>Javascript</a></li>
            <li> <a href="#" id="tile4"><i class="ion-ios7-monitor-outline"></i>React</a></li>
            <li> <a href="#" id="tile5"><i class="ion-ios7-people-outline"></i>Redux</a></li>
        </ul>
    </div>
</Background>
  </Provider>


 );
}
